import React, { useEffect, useState } from "react";
import { Track } from "../../api/track/models/Track";
import { useTheme } from "@mui/material/styles";
import {
  Box,
  Card,
  CardContent,
  CardMedia,
  IconButton,
  Typography,
  Menu,
  MenuItem,
} from "@mui/material";
import DeleteIcon from "@mui/icons-material/Delete";
import { useAudioPlayer } from "../../hooks/useAudioPlayer";
import { PlayTrack } from "../PlayTrack";
import MoreVertIcon from "@mui/icons-material/MoreVert";
import { EditTrackModal } from "../EditTRack/EditTrackModal";
import { Link } from "react-router-dom";

interface TrackItemProps {
  track: Track;
  onDelete: (trackId: string) => void;
  onTrackUpdated: (track: Track) => void;
}

export const TrackListItem: React.FC<TrackItemProps> = ({
  track,
  onDelete,
  onTrackUpdated,
}) => {
  const theme = useTheme();
  const player = useAudioPlayer();

  const [anchorEl, setAnchorEl] = useState<null | HTMLElement>(null);
  const openMenu = Boolean(anchorEl);
  const [isEditOpen, setIsEditOpen] = useState(false);

  const handleMenuClick = (event: React.MouseEvent<HTMLElement>) => {
    setAnchorEl(event.currentTarget);
  };
  const handleMenuClose = () => {
    setAnchorEl(null);
  };

  const handleEditClick = () => {
    setIsEditOpen(true);
    handleMenuClose();
  };

  return (
    <Card
      sx={{
        display: "flex",
        alignItems: "center",
        width: "100%",
        minHeight: 90,
        px: { xs: 2, md: 3 },
        py: 2,
        borderRadius: 3,
        background: "#ffffff",
        border: "1px solid #f0f0f0",
        boxShadow: "0 2px 8px rgba(0,0,0,0.04)",
        transition: "all 0.3s cubic-bezier(0.4, 0, 0.2, 1)",
        cursor: "pointer",
        overflow: "hidden",
        position: "relative",
        "&::before": {
          content: '""',
          position: "absolute",
          left: 0,
          top: 0,
          bottom: 0,
          width: 4,
          background: "linear-gradient(135deg, #667eea 0%, #764ba2 100%)",
          opacity: 0,
          transition: "opacity 0.3s ease",
        },
        "&:hover": {
          background: "linear-gradient(135deg, #f8f9ff 0%, #faf5ff 100%)",
          boxShadow: "0 8px 24px rgba(102, 126, 234, 0.12)",
          transform: "translateY(-2px)",
          border: "1px solid #e0e7ff",
          "&::before": {
            opacity: 1,
          },
        },
      }}
    >
      {/* Cover Image */}
      <CardMedia
        component="img"
        sx={{
          width: { xs: 60, md: 75 },
          height: { xs: 60, md: 75 },
          borderRadius: 2,
          flexShrink: 0,
          objectFit: "cover",
          boxShadow: "0 4px 12px rgba(0,0,0,0.08)",
          transition: "transform 0.3s ease",
          "&:hover": {
            transform: "scale(1.05)",
          },
        }}
        image={
          track.coverImage ||
          "https://media.istockphoto.com/id/2167996762/uk/photo/flamingos-on-lake.jpg?s=2048x2048&w=is&k=20&c=A_twH4lS0xkDGqh1oSO9aOEREPNEJpdRUkwOwsXN7nE="
        }
        alt={track.title}
      />

      {/* Info */}
      <Box
        component={Link}
        to={`/track/${track.slug}`}
        sx={{
          flexGrow: 1,
          ml: { xs: 2, md: 3 },
          minWidth: 0,
          textDecoration: "none",
        }}
      >
        <CardContent sx={{ py: 0, px: 0, "&:last-child": { pb: 0 } }}>
          <Typography
            variant="h6"
            sx={{
              fontWeight: 600,
              overflow: "hidden",
              textOverflow: "ellipsis",
              whiteSpace: "nowrap",
              fontSize: { xs: "1rem", md: "1.1rem" },
              color: "#1a1a1a",
              mb: 0.5,
              transition: "color 0.2s ease",
              "&:hover": {
                color: "#667eea",
              },
            }}
          >
            {track.title}
          </Typography>
          <Typography
            variant="body2"
            sx={{
              overflow: "hidden",
              textOverflow: "ellipsis",
              whiteSpace: "nowrap",
              fontSize: "0.875rem",
              color: "#666",
              mb: 0.25,
            }}
          >
            {track.artist}
          </Typography>
          <Typography
            variant="caption"
            sx={{
              overflow: "hidden",
              textOverflow: "ellipsis",
              whiteSpace: "nowrap",
              fontSize: "0.75rem",
              color: "#999",
              display: "flex",
              alignItems: "center",
              gap: 0.5,
            }}
          >
            {track.album || "Unknown album"}
          </Typography>
        </CardContent>
      </Box>

      {/* Controls */}
      <Box
        sx={{
          display: "flex",
          alignItems: "center",
          gap: { xs: 0.5, md: 1 },
          flexShrink: 0,
        }}
      >
        <PlayTrack key={track.id} track={track} player={player} />
        <IconButton
          color="error"
          size="medium"
          sx={{
            "&:hover": {
              backgroundColor: "rgba(239, 68, 68, 0.1)",
              transform: "scale(1.1)",
            },
            transition: "all 0.2s ease",
          }}
          onClick={() => onDelete(track.id)}
        >
          <DeleteIcon fontSize="small" />
        </IconButton>
        <IconButton
          size="medium"
          sx={{
            color: "#666",
            "&:hover": {
              backgroundColor: "rgba(102, 126, 234, 0.1)",
              color: "#667eea",
              transform: "scale(1.1)",
            },
            transition: "all 0.2s ease",
          }}
          onClick={handleMenuClick}
        >
          <MoreVertIcon fontSize="small" />
        </IconButton>
      </Box>

      {/* Menu */}
      <Menu
        anchorEl={anchorEl}
        open={openMenu}
        onClose={handleMenuClose}
        anchorOrigin={{ vertical: "bottom", horizontal: "right" }}
        transformOrigin={{ vertical: "top", horizontal: "right" }}
        PaperProps={{
          sx: {
            borderRadius: 2,
            boxShadow: "0 8px 24px rgba(0,0,0,0.12)",
            border: "1px solid #f0f0f0",
            minWidth: 150,
          },
        }}
      >
        <MenuItem
          onClick={handleEditClick}
          sx={{
            fontSize: "0.875rem",
            py: 1.5,
            "&:hover": {
              backgroundColor: "rgba(102, 126, 234, 0.08)",
            },
          }}
        >
          Edit Track
        </MenuItem>
      </Menu>

      {/* Edit Modal */}
      <EditTrackModal
        isOpen={isEditOpen}
        onClose={() => setIsEditOpen(false)}
        track={track}
        onTrackUpdated={onTrackUpdated}
      />
    </Card>
  );
};
